#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
const long long big = 1e6;
vector <long long> res;

int main() {
    faster();
    int t;
    cin >> t;
    while ( t-- )
    {
        int n, m;
        cin >> n >> m;
        matrix a, b;
        a.assign(n,vector <long long> (m,0));
        b.assign(n,vector <long long> (m,0));
        for (int i = 0 ; i < n ; i++)
        {
            for (int j = 0 ; j < m ; j++)
            {
                cin >> a[i][j];
            }
        }
        for (int i = 0 ; i < n ; i++)
        {
            for (int j = 0 ; j < m ; j++)
            {
                if ( a[i][j] == 1 )
                {
                    for (int h = 0 ; h < n ; h++)
                    {
                        b[h][j] = 1;
                    }
                    for (int h = 0 ; h < m ; h++)
                    {
                        b[i][h] = 1;
                    }
                }
            }
        }
        for (int i = 0 ; i < n ; i++)
        {
            for (int j = 0 ; j < m ; j++)
            {
                cout << b[i][j] << " ";
            }
            cout << endl;
        }
    }
}

